import React from 'react';
import './Navbar.css';
import logo from './logo.png';

function Navbar() {
    return (
        <nav className="topnav">
        <div> 
          <ul>

            <ul>
              <a href="/">Home</a>
            </ul>
            <ul>
              <a href="http://localhost:3000/login/">Login</a>
            </ul>
            <ul>
              <a href="http://localhost:3000/register/">Sign Up</a>
            </ul>
          </ul>
        </div>
      </nav>

    );


}

export default Navbar;
